        <Link to = "/Login">
        <div className="flex gap-10">
            <h1 className={`${isloggedin?"hidden":"hover:text-blue-500 text-xl"}`}>Log In</h1>
            <h1 className={`${isloggedin?"hover:text-blue-500 text-xl":""}`}>Log In</h1>
        </div>
        </Link>

)}

